import React from "react";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import Home from "./Home/Home";
import AboutProRide from "./About/AboutProRide";
import AboutPhil from "./About/AboutPhil";
import ContactForm from "./Contact/ContactForm";
import ServicesPage from "./Services/ServicesPage";
import NavBar from "./NavBar";
import servicesData from "../data/services";
import SpecificServiceSecond from "./Services/SpecificServiceSecond";

import "bootstrap/dist/css/bootstrap.min.css";
import "../styles/App.css";

function Footer() {
  const date = new Date();

  return (
    <div>
      <footer className="footer pt-5 pb-2 bg-light">
        <div className="container">
          <span className="text-muted text-center">
            Â©ProRide Coaching {date.getFullYear()}
          </span>
        </div>
      </footer>
    </div>
  );
}

function App() {
  return (
    <Router>
      <NavBar />
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route exact path="/services">
          <ServicesPage />
        </Route>
        <Route exact path="/contact">
          <ContactForm />
        </Route>
        <Link to="/aboutProRide">
        <AboutProRide />
      </Link>
        {/* <Route exact path="/aboutProRide">
          <AboutProRide />
        </Route> */}
        <Route exact path="/aboutPhil">
          <AboutPhil />
        </Route>
        {servicesData.map((service, key) => {
          return (
            <Route key={key} exact path={`/${service.name.replace(/\s/g, "")}`}>
              <SpecificServiceSecond
                key={key}
                proRideImg={service.proRideImg}
                proRideImg2={service.proRideImg2}
                img={service.img}
                className="content-div"
                header={service.name}
                header2={service.header2}
                text1={service.text1}
                text2={service.text2}
                flyer={service.flyer}
                flyer2={service.flyer2}
              />
            </Route>
          );
        })}
      </Switch>
      <Footer />
    </Router>
  );
}

export default App;
